  \"Eastern shore of Virginia National Wildlife Refuge small firearms range assessment\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:58.231920\",\n\t\"name\": \"eastern-shore-of-virginia-national-wildlife-refuge-small-firearms-range-assessment\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Eastern Shore of Virginia National
  Wildlife Refuge (Refuge) is located on the southernmost tip of the Delmarva Peninsula
  in Northampton County, Virginia. It consists of a variety of habitats including
  maritime forest, grasslands, fresh and brackish ponds, tidal salt marsh, and beach.
  The Refuge is considered u201cone of the most important avian funnels along the
  east coastu201d (Bright and Sagan, 1987); it provides outstanding foraging and sheltering
  habitat for migrating avian species and productive nursery grounds for fish. In
  2001, the Refuge purchased 375 acres of salt marsh down range of the Northampton
  County small firearms range. The firing range, a two acre in-holding within the
  Refuge, was formerly owned by the Department of Defense and is presumed to have
  been active since the 1930s. In this study, we investigated contaminant levels in
  soils and sediments in the marsh down range of the firing range and along the Virginia
  Inside Passage to assess whether contaminants are present at levels that would pose
  an ecological threat. Samples were also collected from the marsh for lead shot or
  bullet density determination to assess whether lead ingestion would pose a threat
  to birds or other biota. Lead shot or bullets were not found in any sediment samples.
  Only one sample, from the marsh, exceeded the lead Effects Range Low (ERL) level,
  but it was below the Effects Range Median (ERM) and Probable Effect Levels (PEL).
  Arsenic was above the ERL level in seven of the eight marsh samples but did not
  approach either ERM or PEL levels. Nickel was above the ERL level in two of the
  eight marsh samples, but was below the ERM and PEL values. Five organic compounds
  - acenaphthene, anthracene, dieldrin, DDE, and total PCBs - were detected above
  their ERL levels. Only two of those analytes, dieldrin and DDE, were above their
  ERM levels. Of the two samples in which dieldrin was above the ERL, only one was
  above the PEL. The DDE level was above the ERM level in one marsh sample. This study
  indicates the soil and sediment pose no threat to wildlife from lead or other contaminants
  levels and there is no risk of lead poisoning to wildlife via ingestion. The few
  cases in which contaminant levels were elevated are localized and do not pose a
  widespread threat to biota. The ERL is a conservative level and although some levels
  were higher than the ERL, the risk those levels pose to wildlife is negligible.\",\n\t\"license_title\":
